import Post from "./post"
import SignUp from "./signUp"
import Header from "./header"
import {Route, Routes} from "react-router-dom";
function App() {



  return (
      <Routes>
        <Route index element={
          <main>
          <Header />
          <Post />
          <SignUp />
          <Post />
          <Post />
          </main>} 
        />
        <Route path={'/login'} element={
          <div>
            login
          </div>
        } />

      </Routes>

  );
}

export default App;
